Ad Text:
THE COMPANY
Our client operates a large, complex operating platform backed by a global institutional shareholder with exceptionally high expectations around analytical rigour, insight and reporting quality. As the business continues to scale, there is a clear mandate to materially lift the standard of analysis and reporting presented to the Board and shareholder.

THE ROLE
This Senior Business Analyst role, based in Melbourne CBD, reports directly to the CFO and is responsible for delivering high-quality financial and commercial analysis, with a particular focus on board and shareholder materials. The role is suited to a technically strong analyst who can move from detailed modelling to clear, well-structured written and verbal communication, and confidently explain why outcomes are occurring.

THE RESPONSIBILITIES

Deliver deep financial and commercial analysis to support strategy, capital allocation and growth;
Build and maintain robust financial models for forecasting, business cases and scenario analysis;
Prepare board and shareholder-level reporting, including commentary and executive-ready presentations;
Analyse performance drivers, risks and trends, providing clear recommendations to the CFO;
Support budgeting, forecasting and long-range planning processes;
Act as a trusted analytical partner to the CFO on ad-hoc and strategic matters.
THE REQUIREMENTS

3–6+ years’ experience in top-tier consulting, corporate finance, transaction services or high-performing commercial roles;
Strong financial modelling and analytical capability;
Proven ability to produce board-quality written analysis and presentations;
Confident communicator with senior executives and sophisticated stakeholders;
CA / CPA / CFA or similar qualifications highly regarded.
TO APPLY
To enquire, please phone David Compton at Agricultural Appointments on 02 9223 9944 for a confidential discussion or submit your application online.
